import styles from "../styles/navigation.module.css";

export function Navigation(props) {
  return (
    <div className="flex items-center">
      <div className="flex-1 py-6">
        <img src={"/images/logo.svg"} />
      </div>

      <div className="flex-1 text-center px-4 py-2 m-2">
        <section className="flex items-center">
          <a className="flex-1" href="/">Home</a>
          <a className="flex-1" href="/">About</a>
          <a className="flex-1" href="/">Contact</a>
          <a className="flex-1" href="/">Blog</a>
          <a className="flex-1" href="/">Careers</a>
        </section>
      </div>
      <div className="flex-1 text-center px-4 py-2 m-2">3</div>
    </div>
  );
}
